import styles from '../styles/components/blogcontent.module.css'
import { useEffect } from 'react'


export function Blogcontent(props) {
  const { autor, _id, datapost, thumbnail, tipo, title, urlgithub, urlyoutube, content } = props.ArticleM





  useEffect(() => {
    document.querySelector('#texto').innerHTML = content;
  }, [])



  return (
    <div className={styles.blogcontent}>
      <div className={styles.divtag}>
        <a target="_blank" href={itemblog.GITHUB} ><i className="fab fa-github"></i> GitHub</a>
        <h1>{itemblog.TITLE}</h1>
      </div>
      <div className={styles.divtext}>

        <iframe height="500px" width="100%" src={`https://www.youtube.com/embed/${itemblog.YOUTUBE}`} allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" >
        </iframe>


        <div id="texto">
        </div>

      </div>
      <div className={styles.divcontent}></div>
    </div>
  )
}
